import { useEffect, useState } from "react";
import WeaponsList from '../assets/weapons.json';

export default function Weapons() {

    const [type, setType] = useState('');

    const typesList = WeaponsList.map((weapon) => {
      return weapon.power_type;
    });
    
    const filteredList = WeaponsList.filter((weapon) => {
      return type ? weapon.power_type === type : true;
    });

    return(
      <>
        <form>
            <select onChange={(e) => setType(e.target.value)}>
              <option value="">Select a Type</option>
              {typesList.map((type) => (
                <option>{type}</option>
              ))}
            </select>
        </form>



        {filteredList.map((weapon) => (
          <div key={weapon.id}>
            {weapon.name}
          </div>
        ))}
      </>
    );
}
